Switch
   Java中switch支持char\int\byte\short及它们的封装类类型，还有枚举类型。   
​    Java7中额外新增了String类型，这个新特性是编译器这个层次实现的。而在虚拟机和字节代码层次下，还是只支持使用与整数类型兼容的类型。
​    虽然开发人员在java源代码中使用的是String类型，但是在编译过程中，是将String类型替换成对应的hashcode，而case里面的值也被替换成常量的哈希值，然后再case语句中仍然要使用String的equals方法来进行字符串的判断。   
如: Java源代码
public static void xx(String key){
        String sigal = "" ;
        switch (key) {
        case "大于":
            sigal = "大于 > " ;
            break;
        case "小于":
            sigal = "小于 > " ;
            break;
        case "等于":
            sigal = "等于 > " ;
            break;
        default:
            sigal = " 错误 " ;
            break;
        }
        System.out.println(sigal);
    }

编译后
public static void xx(String key) {
      String sigal;
      label23: {
         sigal = "";
         switch(key.hashCode()) {
         case 727623:
            if(key.equals("大于")) {
               sigal = "大于 > ";
               break label23;
            }
            break;
         case 750687:
            if(key.equals("小于")) {
               sigal = "小于 > ";
               break label23;
            }
            break;
         case 998501:
            if(key.equals("等于")) {
               sigal = "等于 > ";
               break label23;
            }
         }
         sigal = " 错误 ";
      }
      System.out.println(sigal);
   }

TWR
   TWR:   try-with-resources，能够被try语句所管理的资源需要满足一个条件，就是其资源java类要实现AutoCloseable接口，否则会出现编译错误。
当需要释放资源的时候，该接口的close方法会被自动调用。   
代码
public void twr(){
    // 可自动关闭
    try(FileInputStream in = new FileInputStream("e:\\fstab");
            FileOutputStream out = new FileOutputStream("e:\\a");){
        byte[] buffer = new byte[1024];
        int len = -1 ;
        while ((len = in.read(buffer)) != -1) {
            out.write(buffer, 0, len);
        }
