算法题方式一方式二算法题
题目：
​    给定两个有序整数数组 A 和 B，将 B 合并到 A 中，使得 A 成为一个有序数组。
说明: 
​    初始化 A 和 B 的元素数量分别为 m 和 n。 
​    你可以假设 A 有足够的空间（空间大小大于或等于 m + n）来保存 B 中的元素。 
示例: 
输入: 
​    A = [1,3,3,4,0,0,0,0],  m = 4 
​    B = [2,5,6], n = 3 
输出: [1,2,3,3,4,5,6]
解题思路：
方式一：先把数组B放到A后面，然后对A做排序
方式二：使用两个指针，分别从AB的尾向前比较移动
