方式二

/**
 * @Description: 
 * 方式二：使用两个指针，分别从AB的尾向前比较移动
 * @author: TianwYam
 * @date 2021年5月23日 上午10:36:43
 * @param A 整型数组A
 * @param m 数组A的有效长度m(实际长度 >= m+n )
 * @param B 整型数组B
 * @param n 数组B的有效长度n
 */
public static void merge2(int[] A, int m, int[] B, int n) {

    // 1.找到存放AB中最大数的位置
    // A数组存放A+B的最后一个位置
    int p = m + n -1 ;

    // A数组的最后一个数
    int a = m -1 ;
    // B数组的最后一个数
    int b = n -1 ;
    while (a >= 0 && b >= 0) {
        // 2.循环判断
        // 若是A最大的数大于B最大的数，则A最大数移动
        // 若是B最大的数大于A最大的数，则B最大数移动
        if (A[a] > B[b]) {
            A[p] = A[a];
            a-- ;
        } else {
            A[p] = B[b];
            b-- ;
        }

        p--;
    }

    // 异常边界判断，还存在B数组还没有循环到的
    while (b >= 0) {
        A[p] = B[b];
        p-- ;
        b-- ; 
    }


}

方式二更加速度更快
